// //카메라가 플레이어 위치로부터 떨어진 거리, 로테이션 값
// const CAMERA_POSITION_WEIGHT_Z = 0;
const CAMERA_POSITION_WEIGHT_Y = 40; 
const CAMERA_ROTATION_X = -90;
const CAMERA_ROTATION_Z = 0;
 
const avatar = REDBRICK.AvatarManager.createDefaultAvatar();
const camera = WORLD.getObject("MainCamera");
// avatar.setFollowingCamera(camera);
avatar.setDefaultController();
 
//카메라 Y값 및 로테이션 초기값 설정
camera.position.y = CAMERA_POSITION_WEIGHT_Y;
camera.rotation.set(toRadians(CAMERA_ROTATION_X), 0, toRadians(CAMERA_ROTATION_Z)); //rotation.set() 메소드는 매개변수를 라디안으로 입력 받습니다
 
// Degree (도)를 Radian (라디안)으로 변환하는 함수
function toRadians(degrees) {
  return degrees * Math.PI / 180;
}
 
//매 프레임 마다 카메라의 X와 Z값을 플레이어로부터 일정한 거리로 업데이트 해줍니다
function Update(){
    camera.position.x = avatar.position.x;
    camera.position.z = avatar.position.z;
}

let previousPosition = null;

function Start() {
    // Initialize previousPosition with the player's starting position
    previousPosition = PLAYER.position.clone();
}

function Update(dt) {
    getPlayerMovementDirection();
}

function getPlayerMovementDirection() {
    let currentPosition = PLAYER.position;
    let directionVector = currentPosition.clone().sub(previousPosition);
    let direction;

    if (directionVector.length() > 0) {
        directionVector.normalize();

        // Determine direction based on direction vector
        if (directionVector.z > 0.5 && Math.abs(directionVector.x) <= 0.5) {
            direction = "South";
        } else if (directionVector.z < -0.5 && Math.abs(directionVector.x) <= 0.5) {
            direction = "North";
        } else if (directionVector.x > 0.5 && Math.abs(directionVector.z) <= 0.5) {
            direction = "East";
        } else if (directionVector.x < -0.5 && Math.abs(directionVector.z) <= 0.5) {
            direction = "West";
        } else if (directionVector.x > 0.5 && directionVector.z > 0.5) {
            direction = "South-East";
        } else if (directionVector.x > 0.5 && directionVector.z < -0.5) {
            direction = "North-East";
        } else if (directionVector.x < -0.5 && directionVector.z > 0.5) {
            direction = "South-West";
        } else if (directionVector.x < -0.5 && directionVector.z < -0.5) {
            direction = "North-West";
        }

        console.log("Player Movement Direction:", direction);
    }

    // Update previous position
    previousPosition.copy(currentPosition);
}
